import React from "react";

type ROUTES = {
  name: string;
  path: string;
  component: React.FC;
  exact?: boolean;
  keyRole?: string;
  auth?: boolean;
};

const routesProps: ROUTES[] = [
  //GUEST
  {
    name: "homePage",
    path: "/",
    component: React.lazy(() => import("../pages/guest/Guest")),
    exact: true,
    keyRole: "guest",
    auth: false,
  },
  {
    name: "chienlogin",
    path: "/chienlogin",
    component: React.lazy(() => import("../pages/auth/Login")),
    exact: true,
    keyRole: "guest",
    auth: false,
  },
  //ADMIN
  {
    name: "user",
    path: "/user",
    component: React.lazy(() => import("../pages/admin/User")),
    exact: true,
    keyRole: "admin",
    auth: true,
  },
  {
    name: "product",
    path: "/product",
    component: React.lazy(() => import("../pages/admin/Product")),
    exact: true,
    keyRole: "admin",
    auth: true,
  },
  {
    name: "newproduct",
    path: "/newproduct",
    component: React.lazy(() => import("../pages/admin/NewProduct")),
    exact: true,
    keyRole: "admin",
    auth: true,
  },
  {
    name: "typeproduct",
    path: "/typeproduct",
    component: React.lazy(() => import("../pages/admin/TypeProduct")),
    exact: true,
    keyRole: "admin",
    auth: true,
  },
  {
    name: "newtypeproduct",
    path: "/newtypeproduct",
    component: React.lazy(() => import("../pages/admin/NewTypeProduct")),
    exact: true,
    keyRole: "admin",
    auth: true,
  },
];

export default routesProps;
